INSERT INTO `admin` VALUES (1,'admin','619c9bd9724b54165a0b3ea9b564b8605783a8f115175fcfc03188173325d6806c9f3a1b','2023-09-01','2021-08-01','...we are here for you!','NOCEN HOSTELS','NOCEN, a pioneer educational Institute of Nigeria, has been striving to provide quality higher education since 1994. Approved by NCE and ASUU, NOCEN has a sprawling multi-discipline campus, world class facilities and competent faculty, with prime focus on research and quality education. Creating a benchmark in the field of education, NOCEN aims to create proficient \r\nand future leaders with emphasis on overall development of personality imbibing core human values among students.','NOCEN Hostels','A,B,C,D...','About NOCEN','Our College is dedicated to preparing students with the knowledge, skills and training needed for meaningful employment. \r\nThrough education, we create opportunities, change lives and impact futures.Our values-\r\nWe are dedicated to preparing students for meaningful employment. We provide a quality education and learning environment. We embody integrity in everything we do. We believe in partnership with employers, students, graduates and our communities.\r\n We have pride in our students and are passionate about their success. We respect diversity and believe all people should have the opportunity to get an education and find meaningful employment. We believe in continuous improvement and exploring new ideas.\r\n Since its inception, NOCEN has been a leader in career-focused education, meeting workforce needs for in-demand employment fields.\r\n As occupational challenges and opportunities are recognized, NOCEN develops new programs in cooperation with industry leaders to meet the needs of our students and graduates and of employers, as well.','pay your fees, verify with student affairs, choose from available bed space and head to your room','support@nocenhostels.edu.ng','08098491880','52 ikema avenue, ogidi, nsugbe','nocen hostels','first bank plc','1111111111','',1,'2023-09-22 05:40:09');
