/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `after_update_bedspace` AFTER UPDATE ON `bedspace` FOR EACH ROW BEGIN
DECLARE room_id int;DECLARE total_occ int;DECLARE total int;DECLARE diff int;DECLARE filled int;
select room_id into room_id from bedspace where bed_id=NEW.bed_id;
select count(*) into total from bedspace where room_id=room_id;
select count(*) into total_occ from bedspace where room_id=room_id and occupied=1;
set diff=total-total_occ;
update rooms set bsp_occup=total_occ,bsp_avail=diff where room_id=room_id;
if diff=0 then set filled=1;
update rooms set filled=filled where room_id=room_id;
END IF;
end */;;
